import './App.css';
import Header from './components/Header/Header';


import HeadSlider from './components/Header/Slider';
import Static from './components/Header/static';
import Advert from './components/Advert/advert';
import SellersSection from './components/sellers/sellersSection';
import PopularCategories from './components/popularCategories/popularCategories';
import NewArrivals from './components/newArrivals/newArrivals';


function App() {
  return (
    <>
      <Header/>
       <HeadSlider/> 
       <Static/>
       <Advert/>
       <SellersSection/>
       <PopularCategories/>
       <NewArrivals/>

<div class="banner-area-2">
<div class="container">
<div class="row">
<div class="col-md-12">
<div class="banner-inner">
<a href="shop-4-column.html"><img src="assets/images/banner-image/28.jpg" alt="" /></a>
</div>
</div>
</div>
</div>
</div>

    </>
  );
}

export default App;
